        ModuleContent1: 'PetJoy ‚Äî —ç—Ç–æ –æ–Ω–ª–∞–π–Ω-—Å–æ–æ–±—â–µ—Å—Ç–≤–æ, —Å–æ–∑–¥–∞–Ω–Ω–æ–µ –∫–æ–º–∞–Ω–¥–æ–π —Å—Ç—É–¥–µ–Ω—Ç–æ–≤ –®–∫–æ–ª—ã –ø—Ä–æ–≥—Ä–∞–º–º–Ω–æ–π –∏–Ω–∂–µ–Ω–µ—Ä–∏–∏ –£–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–∞ –¢—É–Ω—Ü–∑–∏. –ö–∞–∫ –∫–æ–º–∞–Ω–¥–∞ –∏–∑ –¥–µ—Å—è—Ç–∏ —á–µ–ª–æ–≤–µ–∫, –º—ã —Å—Ç—Ä–µ–º–∏–º—Å—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Å–≤–æ–∏ –∑–Ω–∞–Ω–∏—è –∏ –Ω–∞–≤—ã–∫–∏ –¥–ª—è —Å–æ–∑–¥–∞–Ω–∏—è —Ç–µ–ø–ª–æ–π –∏ –¥—Ä—É–∂–µ–ª—é–±–Ω–æ–π –ø–ª–∞—Ç—Ñ–æ—Ä–º—ã, –≥–¥–µ –ª—é–±–∏—Ç–µ–ª–∏ –¥–æ–º–∞—à–Ω–∏—Ö –∂–∏–≤–æ—Ç–Ω—ã—Ö —Å–æ –≤—Å–µ–≥–æ –º–∏—Ä–∞ –º–æ–≥—É—Ç –æ–±—â–∞—Ç—å—Å—è, –¥–µ–ª–∏—Ç—å—Å—è –æ–ø—ã—Ç–æ–º –∏ –ø–æ–ª—É—á–∞—Ç—å –ø—Ä–æ—Ñ–µ—Å—Å–∏–æ–Ω–∞–ª—å–Ω—ã–µ –∑–Ω–∞–Ω–∏—è –æ –¥–æ–º–∞—à–Ω–∏—Ö –∂–∏–≤–æ—Ç–Ω—ã—Ö. –ù–µ–∑–∞–≤–∏—Å–∏–º–æ –æ—Ç —Ç–æ–≥–æ, —è–≤–ª—è–µ—Ç–µ—Å—å –ª–∏ –≤—ã –Ω–æ–≤—ã–º –≤–ª–∞–¥–µ–ª—å—Ü–µ–º –¥–æ–º–∞—à–Ω–µ–≥–æ –∂–∏–≤–æ—Ç–Ω–æ–≥–æ –∏–ª–∏ –æ–ø—ã—Ç–Ω—ã–º, PetJoy ‚Äî –≤–∞—à –∏–¥–µ–∞–ª—å–Ω—ã–π –≤—ã–±–æ—Ä.',
        ModuleTitle2: '–ù–∞—à–µ –í–∏–¥–µ–Ω–∏–µ',
        ModuleContent2: '1. –°—Ç–∞—Ç—å –∑–Ω–∞—á–∏–º—ã–º –º–∏—Ä–æ–≤—ã–º —Å–æ–æ–±—â–µ—Å—Ç–≤–æ–º –ª—é–±–∏—Ç–µ–ª–µ–π –¥–æ–º–∞—à–Ω–∏—Ö –∂–∏–≤–æ—Ç–Ω—ã—Ö: –ú—ã —Å—Ç—Ä–µ–º–∏–º—Å—è —Å–¥–µ–ª–∞—Ç—å PetJoy –≥–ª–∞–≤–Ω—ã–º –º–µ—Å—Ç–æ–º –≤—Å—Ç—Ä–µ—á–∏ –ª—é–±–∏—Ç–µ–ª–µ–π –¥–æ–º–∞—à–Ω–∏—Ö –∂–∏–≤–æ—Ç–Ω—ã—Ö –ø–æ –≤—Å–µ–º—É –º–∏—Ä—É –ø–æ—Å—Ä–µ–¥—Å—Ç–≤–æ–º –Ω–∞—à–∏—Ö –ø–æ—Å—Ç–æ—è–Ω–Ω—ã—Ö —É—Å–∏–ª–∏–π.',
