        ModuleContent4: '3. –°–æ–¥–µ–π—Å—Ç–≤–æ–≤–∞—Ç—å –∑–¥–æ—Ä–æ–≤–æ–º—É —Ä–∞–∑–≤–∏—Ç–∏—é –∏–Ω–¥—É—Å—Ç—Ä–∏–∏ —Å–æ–¥–µ—Ä–∂–∞–Ω–∏—è –¥–æ–º–∞—à–Ω–∏—Ö –∂–∏–≤–æ—Ç–Ω—ã—Ö: –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª—è—è –≤—ã—Å–æ–∫–æ–∫–∞—á–µ—Å—Ç–≤–µ–Ω–Ω—É—é –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –∏ —É—Å–ª—É–≥–∏, –º—ã –Ω–∞–¥–µ–µ–º—Å—è –ø–æ–º–æ—á—å –∏–Ω–¥—É—Å—Ç—Ä–∏–∏ —Å–æ–¥–µ—Ä–∂–∞–Ω–∏—è –¥–æ–º–∞—à–Ω–∏—Ö –∂–∏–≤–æ—Ç–Ω—ã—Ö —Ä–∞–∑–≤–∏–≤–∞—Ç—å—Å—è –≤ –±–æ–ª–µ–µ –∑–¥–æ—Ä–æ–≤–æ–º –Ω–∞–ø—Ä–∞–≤–ª–µ–Ω–∏–∏.',
        ModuleTitle3: '–ù–∞—à–∞ –ú–∏—Å—Å–∏—è –ò –î—É—Ö',
        ModuleContent5: '–û—Å–Ω–æ–≤–Ω–∞—è –∫–æ–º–∞–Ω–¥–∞ PetJoy —Å–æ—Å—Ç–æ–∏—Ç –∏–∑ —É–≤–ª–µ—á–µ–Ω–Ω—ã—Ö –∏ –∑–∞–±–æ—Ç–ª–∏–≤—ã—Ö —Å—Ç—É–¥–µ–Ω—Ç–æ–≤ –®–∫–æ–ª—ã –ø—Ä–æ–≥—Ä–∞–º–º–Ω–æ–π –∏–Ω–∂–µ–Ω–µ—Ä–∏–∏ –£–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–∞ –¢—É–Ω—Ü–∑–∏. –ú—ã –Ω–µ —Ç–æ–ª—å–∫–æ –ª—é–±–∏–º –∂–∏–≤–æ—Ç–Ω—ã—Ö, –Ω–æ –∏ –æ–±–ª–∞–¥–∞–µ–º –ø—Ä–æ—á–Ω–æ–π –±–∞–∑–æ–π –≤ –æ–±–ª–∞—Å—Ç–∏ –∫–æ–º–ø—å—é—Ç–µ—Ä–Ω—ã—Ö –Ω–∞—É–∫ –∏ –æ–±—à–∏—Ä–Ω—ã–º –æ–ø—ã—Ç–æ–º –ø—Ä–æ–≥—Ä–∞–º–º–∏—Ä–æ–≤–∞–Ω–∏—è.',
        ModuleContent6: '–ù–∞—à ',
        ModuleTitle4: '–º–∏—Å—Å–∏—è –∫–æ–º–∞–Ω–¥—ã ',
        ModuleContent7: '—è–≤–ª—è–µ—Ç—Å—è:',
        ModuleTitle5: '‚≠ê –£—Ö–æ–¥: ',
