        ZhexvLiang: 'Zhexv Liang',
        SiyuanZhao: 'Siyuan Zhao',
        YukunYang: 'Yukun Yang',
        YaoLiu: 'Yao Liu',
        MohanWang: 'Mohan Wang',
        JishenLinDescription: '–Ø —Å—Ç—É–¥–µ–Ω—Ç –±–∞–∫–∞–ª–∞–≤—Ä–∏–∞—Ç–∞ –ø–æ –ø—Ä–æ–≥—Ä–∞–º–º–Ω–æ–π –∏–Ω–∂–µ–Ω–µ—Ä–∏–∏, —Å–ø–µ—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –ò—Å–∫—É—Å—Å—Ç–≤–µ–Ω–Ω—ã–π –∏–Ω—Ç–µ–ª–ª–µ–∫—Ç. –°—Ç–∞—Ä–æ—Å—Ç–∞ –≥—Ä—É–ø–ø—ã, –ø—Ä–µ–¥—Å–µ–¥–∞—Ç–µ–ª—å –¢–µ—Ö–∫–ª—É–±–∞ Huawei, —á–ª–µ–Ω –ê—Å—Å–æ—Ü–∏–∞—Ü–∏–∏ –ø—Ä–∏ –¢–æ–Ω—Ü–∑–∏. –£–≤–ª–µ–∫–∞—é—Å—å full-stack —Ä–∞–∑—Ä–∞–±–æ—Ç–∫–æ–π. –ò–Ω—Ç–µ—Ä–µ—Å—É—é—Å—å –≥–ª—É–±–æ–∫–∏–º –æ–±—É—á–µ–Ω–∏–µ–º –∏ –∫–æ–º–ø—å—é—Ç–µ—Ä–Ω—ã–º –∑—Ä–µ–Ω–∏–µ–º. –†–∞–¥ –±—É–¥—É –æ–±—â–µ–Ω–∏—é –∏ —Å–æ–≤–º–µ—Å—Ç–Ω–æ–º—É —Ä–∞–∑–≤–∏—Ç–∏—é!',
        ChengzheZhongDescription: '–Ø —Å—Ç—É–¥–µ–Ω—Ç –±–∞–∫–∞–ª–∞–≤—Ä–∏–∞—Ç–∞ –ø–æ —Å–ø–µ—Ü–∏–∞–ª—å–Ω–æ—Å—Ç–∏ ¬´–ü—Ä–æ–≥—Ä–∞–º–º–Ω–∞—è –∏–Ω–∂–µ–Ω–µ—Ä–∏—è¬ª –≤ –£–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–µ –¢—É–Ω—Ü–∑–∏, —Å–ø–µ—Ü–∏–∞–ª–∏–∑–∏—Ä—É—é—Å—å –Ω–∞ —Å–µ—Ç–µ–≤–æ–º –ø—Ä–æ–≥—Ä–∞–º–º–Ω–æ–º –æ–±–µ—Å–ø–µ—á–µ–Ω–∏–∏ –∏ –∏–Ω—Ç–µ–ª–ª–µ–∫—Ç–µ. –Ø –∞–∫—Ç–∏–≤–Ω–æ —É—á–∞—Å—Ç–≤–æ–≤–∞–ª –≤ —Ä–∞–∑–ª–∏—á–Ω—ã—Ö –ø—Ä–æ–µ–∫—Ç–∞—Ö, —Å—Ç—Ä–µ–º—è—Å—å –ø—Ä–∏–º–µ–Ω—è—Ç—å —Ç–µ–æ—Ä–µ—Ç–∏—á–µ—Å–∫–∏–µ –∑–Ω–∞–Ω–∏—è –¥–ª—è —Ä–µ—à–µ–Ω–∏—è –ø—Ä–∞–∫—Ç–∏—á–µ—Å–∫–∏—Ö –∑–∞–¥–∞—á. –Ø —É–≤–ª–µ—á–µ–Ω –∏—Å—Å–ª–µ–¥–æ–≤–∞–Ω–∏–µ–º –Ω–æ–≤—ã—Ö —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏–π.',
        MingzheLiDescription: '–Ø —É—á—É—Å—å –Ω–∞ –£–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–µ –¢—É–Ω—Ü–∑–∏. –ú–Ω–µ –Ω—Ä–∞–≤–∏—Ç—Å—è –∏–∑—É—á–∞—Ç—å –Ω–æ–≤—ã–µ —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏–∏ –∏ —Ä–µ—à–∞—Ç—å –Ω–æ–≤—ã–µ –∑–∞–¥–∞—á–∏, —á—Ç–æ–±—ã –ø–æ—Å—Ç–æ—è–Ω–Ω–æ —Å–æ–≤–µ—Ä—à–µ–Ω—Å—Ç–≤–æ–≤–∞—Ç—å —Å–≤–æ–∏ —Å–ø–æ—Å–æ–±–Ω–æ—Å—Ç–∏. –Ø —Ç–≤–µ—Ä–¥–æ –≤–µ—Ä—é, —á—Ç–æ —Ç–æ–ª—å–∫–æ –ø–æ—Å—Ä–µ–¥—Å—Ç–≤–æ–º –Ω–µ–ø—Ä–µ—Ä—ã–≤–Ω–æ–≥–æ –æ–±—É—á–µ–Ω–∏—è –∏ –ø—Ä–∞–∫—Ç–∏–∫–∏ –º—ã —Å–º–æ–∂–µ–º –æ—Å—Ç–∞–≤–∞—Ç—å—Å—è –∫–æ–Ω–∫—É—Ä–µ–Ω—Ç–æ—Å–ø–æ—Å–æ–±–Ω—ã–º–∏ –±—ã—Å—Ç—Ä–æ —Ä–∞–∑–≤–∏–≤–∞—é—â–µ–π—Å—è –æ–±–ª–∞—Å—Ç–∏ —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏–π.',
        TianleDuDescription: '–Ø —Å—Ç—É–¥–µ–Ω—Ç –±–∞–∫–∞–ª–∞–≤—Ä–∏–∞—Ç–∞ –ø–æ –ø—Ä–æ–≥—Ä–∞–º–º–Ω–æ–π –∏–Ω–∂–µ–Ω–µ—Ä–∏–∏ –≤ —É–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–µ –¢—É–Ω—Ü–∑–∏, –∏–∑—É—á–∞—é –ø—Ä–æ–≥—Ä–∞–º–º–Ω–æ–µ –æ–±–µ—Å–ø–µ—á–µ–Ω–∏–µ –∏ –æ–±—Ä–∞–±–æ—Ç–∫—É –¥–∞–Ω–Ω—ã—Ö. –£ –º–µ–Ω—è —Ö–æ—Ä–æ—à–∏–µ –ø—Ä–∞–∫—Ç–∏—á–µ—Å–∫–∏–µ –Ω–∞–≤—ã–∫–∏ –∏ –ø—Ä–∏–≤—ã—á–∫–∏ —Ä–∞–∑—Ä–∞–±–æ—Ç–∫–∏. –•–æ—á—É –ø—Ä–∏–º–µ–Ω–∏—Ç—å –∑–Ω–∞–Ω–∏—è –Ω–∞ –ø—Ä–∞–∫—Ç–∏–∫–µ –∏ –≤–Ω–µ—Å—Ç–∏ –≤–∫–ª–∞–¥ –≤ –∫–æ–º–∞–Ω–¥—É.',
        ShuyiLiuDescription: '–ö–∞–∫ –ø–µ—Ä–≤–æ–∫—É—Ä—Å–Ω–∏–∫ –ø–æ —Å–ø–µ—Ü–∏–∞–ª—å–Ω–æ—Å—Ç–∏ ¬´–ü—Ä–æ–≥—Ä–∞–º–º–Ω–∞—è –∏–Ω–∂–µ–Ω–µ—Ä–∏—è¬ª –£–Ω–∏–≤–µ—Ä—Å–∏—Ç–µ—Ç–∞ –¢—É–Ω—Ü–∑–∏ (2022 –≥–æ–¥), —è —Å–æ—Å—Ä–µ–¥–æ—Ç–æ—á–µ–Ω –Ω–∞ —Ä–∞–∑–≤–∏—Ç–∏–∏ –ø—Ä–∞–∫—Ç–∏—á–µ—Å–∫–∏—Ö –Ω–∞–≤—ã–∫–æ–≤. –£ –º–µ–Ω—è –µ—Å—Ç—å –Ω–∞—á–∞–ª—å–Ω—ã–π –æ–ø—ã—Ç —Ä–∞–∑—Ä–∞–±–æ—Ç–∫–∏ –ø—Ä–∏–ª–æ–∂–µ–Ω–∏–π, –ª—é–±–ª—é –∏–∑—É—á–∞—Ç—å –Ω–æ–≤—ã–µ —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏–∏, —Ü–µ–Ω—é –∫–æ–º–∞–Ω–¥–Ω—É—é —Ä–∞–±–æ—Ç—É –∏ –æ–±—â–µ–Ω–∏–µ.',
